import React, { Fragment } from 'react';
import Formdate from './Formdate';
import '../css/App.css';
import {Container, Row, Col} from 'react-bootstrap';

function App() {
  return (
    <Fragment>
      <h1 className="text-center text-info text-uppercase py-5">Administrador de Pacientes</h1>
      <Container>
        <Row>
          <Col xs={12} md={6}>
            <Formdate />
          </Col>
          <Col xs={12} md={6}>
          </Col>
        </Row>
      </Container>
    </Fragment>
  );
}

export default App;
